let DatePickerStartViewInstance = null;
module.exports = class startView {

    constructor() {
        if (!DatePickerStartViewInstance) {
            DatePickerStartViewInstance = this;
            //set all other default values

            this.displayAs = 'Start View';
            this.value = 'startView'
            this.type = 'DROPDOWN';
            this.values = [
                { display: "Month", value: "month", default: true},                
                { display: "Year", value: "year"},
                { display: "Multi-Year", value: "multi-year"}

            ];
        }

        return DatePickerStartViewInstance;
    }
}